export const ROUTES = [
    {
        path: "/",
        element: <Layout />,
        children: [
            {
                path: "",
                element: <Home/>
            },
        ]
    },
    {
        path:"/login",
        elment: <Login/>,
        children: [
            {
                path: "",
                element: <Form/>,
            },

        ]
    }
]
